import axios from 'axios'

const USERS_REST_API_URL = 'http://localhost:8080/api/users';

class UserService {

    getUsers(){
        return axios.get(USERS_REST_API_URL);
    };
    refreshPage() {
        window.location.reload(false);
    }

}

export default new UserService();
